// file uploader
jQuery(document).ready(function ($) {
    jQuery('#fileuploader').change(function (ev) {
        if ($('#fileuploader').val().split('\\').pop() != '') {
            $(".samplefile").hide();
            $(".browse-file").hide();
            $(".samplefile2").html($('#fileuploader').val().split('\\').pop());
            $('.remove-file').show();
        }
    });
    jQuery('.remove-file').click(function (event) {
        $(".samplefile").show();
        $(".browse-file").show();
        $(".samplefile2").html('');
        $('#fileuploader').val('');
        $('.remove-file').hide();
    });
});

$('document').ready(function(){
    $('.service-list-ul a').on('click touchstart', function(event) {
        event.preventDefault();
        $('.service-list-ul li').removeClass('active');
        $(this).parent('li').addClass('active');
        $('.service-desc').not($(this).attr('href')).hide();
        $($(this).attr('href')).show();
        $('.service-desc').not($(this).attr('href')).removeClass('active');
        $($(this).attr('href')).addClass('active');
    });
});
$('document').ready(function(){
    $('.right-tab a').on('click touchstart', function(event) {
        event.preventDefault();
        $('.right-tab li').removeClass('active');
        $(this).parent('li').addClass('active');
        $('.right-desc').not($(this).attr('href')).hide();
        $($(this).attr('href')).show();
        $('.right-desc').not($(this).attr('href')).removeClass('active');
        $($(this).attr('href')).addClass('active');
    });
    $("#services-accordion .service-right a").click(function () {
        var current_li = $(this).parents('li');
        $("#services-accordion li .services-form").each(function (i, el) {
            if ($(el).parents().is(current_li)) {
                $(el).prev().toggleClass("active");
                $(el).slideToggle();
            } else {
                $(el).prev().removeClass("active");
                $(el).slideUp();
            }
        });
    });
    $('.system-info-tab .nav-tabs li a[data-toggle="tab"]').on('shown.bs.tab', function (e) {
        $($.fn.dataTable.tables(true)).DataTable().columns.adjust().responsive.recalc();
        $('.order-table').DataTable().columns.adjust().draw();
    });
    $('.burger-menu-dropdown .checkbox').click(function(event){
     event.stopPropagation();
    });
    $('.user-filter-dropdown .checkbox').click(function(event){
     event.stopPropagation();
    });
});
